'O04206',
'NRPE1_ARATH',
'DNA-directed RNA polymerase V subunit 1',
NULL,
1,
'UniProtKB/Swiss-Prot',
'2011-5-3',
'2020-12-2',
'DNA-dependent RNA polymerase catalyzes the transcription of DNA into RNA using the four ribonucleoside triphosphates as substrates. Largest and catalytic component of RNA polymerase V involved in RNA-directed DNA methylation-dependent (RdDM) silencing of endogenous repeated sequences, including transposable elements. Also required for full erasure of methylation when the RNA trigger is withdrawn. Seems also involved in the synthesis of short-interfering RNAs (siRNA). Essential component of a self-reinforcing loop coupling de novo DNA methylation to siRNA production. Involved in the maintenance of post-transcriptional RNA silencing.',
'UP000006548');

